@littlebluebox: After this one goes Fringe, Gray, Burn Notice, The Mentalist, Bones. Everything is encoded and ready to go - but when - depends not on me but the people. Please guys, please, DO NOT put your upload speed AS LOW AS CAN GO. True leechers will be kicked out, and any tampering with speeds (just during the download) would be appropriately "rewarded".

This shitty behavior cannot go forever. I can go, some morons can go - but who will that be, depends on you.
